import { useAuthContext } from '../hooks/useAuthContext'
const BookHouse = () => {
    const { user } = useAuthContext()
    const Booked = (e) => {
        const id = JSON.parse(localStorage.getItem("Bookid"));

        console.log({ id:id.id })
        fetch(`http://localhost:4000/BookHouse/${id.id}`,{
            method:"POST",
            headers:{
                "Authorization":`Bearer ${user.token}`
            },
            body:JSON.stringify({
                id:id.id,
                FromDate:id.FromDate,
                ToDate: id.ToDate,
                Email:id.userEmail
            })
        })
        .then((res) => {
            return res.json();
        }).then((date) => {
            console.log(date);
        })
    }
  return (
    <div>BookHouse
        <div>
            <button onClick={Booked}>Book</button>
        </div>
    </div>
  )
}

export default BookHouse
